Found these posted elsewhere and decided to put them up here.  All credit goes to the original poster.


Original Description:

Found these on an old flash drive last night, forgot I even had them, and figured I'd share.

Got these several years ago when I went with a friend to visit his girl at her dorm at Texas A&amp;M.  Her roommate's laptop was just there, so I dug around it while my friend and his girl were preoccupied and found and copied them.



